export class ComplicationFoie
{
    PatientId:number;
    Hepatomegaly:boolean;
    Fibrotest:boolean;
    Preciser:string;
    ExplorationHepatiqueAutre:string
    PreciserExploration:string
    Irmhepatique:boolean;
    constructor()
    {
        this.PatientId=0;
        this.Hepatomegaly=false;
        this.Fibrotest=false;
        this.Preciser='';
        this.ExplorationHepatiqueAutre='';
        this.PreciserExploration='';
        this.Irmhepatique=false;


    }
}
